            <span class="float-right nav-bar-btn">桌号:{{this.$store.getters.getTableName}}</span>
        </header>
        <div class="mui-content" id="home">
            <div class="list" id="footer">
                <div @click="jump('TOORDER')" style="padding-bottom: 1rem;">
                    <img src="../../.././static/img/GoPlay.png" alt="点餐">
                    <div class="btn">去点单</div>
                </div>
                <div @click="jump('GOPAY')" style="padding-bottom: 1rem;">
                    <img src="../../../static/img/payment.png" class="payment-icon">
                    <div class="btn">去付款</div>
                </div>
                <div @click="jump('REGISTER')" style="padding-bottom: 1rem;" v-if="this.$store.getters.getIsStoreUser=='FALSE'">
                    <img src="../../../static/img/register.png" class="payment-icon">
                    <div class="btn">会员注册</div>
                </div>
            </div>
        </div>
        <div class="last-order" v-if="isLastOrder" @click="pushOrderDetail">
            <div>上笔订单</div>
        </div>
    </div>
</template>

<script>
    export default {
        name: "HomeDetails",
        data() {
            return {
                isShow: true,
            }
        },
        methods: {
            jump(type) {
                document.body.className = "";
                if (type == "TOORDER") {
                    this.$router.replace("/order");
                } else if (type == "GOPAY") {
                    this.$router.replace("/pay")
                }
                else if(type=="REGISTER"){
                    this.$router.replace('/register')
                }
            },
            pushOrderDetail() {
                document.body.className = "";
                this.$store.commit("orderNum", this.lastOrderNum); //订单号，改订单号作用于堂食
                this.$router.replace("/paySuccess")
            },
            init() {

            }
        },
        props: ["isLastOrder", "lastOrderNum","isVip"],
        created() {

        }
    }
</script>

